    }
    testing()
  }, [])

  useEffect(() => {
    console.log(data);

  }, [data])

  return (
    <BrowserRouter>
    <Navigation />
    <div className="scroll-smooth">
      <Routes>
        <Route path="/" element={<Portfolio />} />
        <Route path="/demos" element={<Demos />} />
        <Route path="/game" element={<Game />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </div>
    </BrowserRouter>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));

